clob_loc CLOB;

BEGIN

  select report_definition
  into clob_loc
  from dqa_report_template
  where template_id = 6
  for update;

  dbms_lob.write(lob_loc=>clob_loc, amount=>length(line1), offset=>1, buffer=>line1);
  dbms_lob.write(lob_loc=>clob_loc, amount=>length(line2), offset=>length(line1)+1, buffer=>line2);
  dbms_lob.write(lob_loc=>clob_loc, amount=>length(line3), offset=>length(line1)+length(line2)+1, buffer=>line3);
  commit;
  dbms_output.put_line('report_definition completed');

EXCEPTION WHEN OTHERS THEN
  dbms_output.put_line('OTHERS Exception thrown: ' || SQLERRM);
  
END;
